import React from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends React.Component {
  constructor() {
    super(this.props);
  }

  render() {
    return (
      <div>
        <h1>Hello</h1>
        <h2>{this.props.text}</h2>
      </div>
    );
  }
}

export default App;
